import styled from "@emotion/styled";

const Container = styled.div`
  height: 50rem;
  flex: 1;
  > h1 {
    text-align: center;
  }
`;

const CategoryResultContianer = styled.div`
  background: white;
`;

export const CategoryList = () => {
  return (
    <Container>
      <h1>Catagories</h1>
      <CategoryResultContianer></CategoryResultContianer>
    </Container>
  );
};
